import React from "react";
import "./toggle.css"

const Toggle = (props) => {
    return (
        <>
            <div className="teste">
                <label className="switch">
                    <input type="checkbox"
                    checked={props.presenca} />
                    <span class="slider round"></span>
                </label>
            </div>
        </>
    )
}

export default Toggle;
